precision mediump float;
uniform sampler2D _tex;
varying vec2 vTextureCoord;
uniform vec3 off;
float grey(vec4 c) {
 return dot(c.rgb, vec3(0.299, 0.587, 0.114));
}
void main(){
  float p00,p01,p02,p10,p12,p20,p21,p22,gx,gy,edgeSqr;
  p00 = grey(texture2D( _tex, vTextureCoord + vec2(-off.x, -off.y)));
  p01 = grey(texture2D( _tex, vTextureCoord + vec2( 0.0,   -off.y)));
  p02 = grey(texture2D( _tex, vTextureCoord + vec2( off.x, -off.y)));
  p10 = grey(texture2D( _tex, vTextureCoord + vec2(-off.x, 0.0)));
  p12 = grey(texture2D( _tex, vTextureCoord + vec2( off.x, 0.0)));
  p20 = grey(texture2D( _tex, vTextureCoord + vec2(-off.x, off.y)));
  p21 = grey(texture2D( _tex, vTextureCoord + vec2( 0.0,   off.y)));
  p22 = grey(texture2D( _tex, vTextureCoord + vec2( off.x, off.y)));
  gx = (p00 + 2.0*p10 + p20) - (p02 + 2.0*p12 + p22);
  gy = (p00 + 2.0*p01 + p02) - (p20 + 2.0*p21 + p22);
  edgeSqr = gx*gx + gy*gy;
  if(edgeSqr > off.z)
      gl_FragColor.rgb = vec3(0.0,0.0,0.0);
  else
      gl_FragColor = texture2D( _tex, vTextureCoord);
}

precision mediump float;
uniform sampler2D _tex;
varying vec2 blurCoordinates[9];
void main(){
  vec4 sum = vec4(0.0);
  sum += texture2D(_tex, blurCoordinates[0])/9.0;
  sum += texture2D(_tex, blurCoordinates[1])/9.0;
  sum += texture2D(_tex, blurCoordinates[2])/9.0;
  sum += texture2D(_tex, blurCoordinates[3])/9.0;
  sum += texture2D(_tex, blurCoordinates[4])/9.0;
  sum += texture2D(_tex, blurCoordinates[5])/9.0;
  sum += texture2D(_tex, blurCoordinates[6])/9.0;
  sum += texture2D(_tex, blurCoordinates[7])/9.0;
  sum += texture2D(_tex, blurCoordinates[8])/9.0;
  gl_FragColor = sum;
}

attribute vec4 aPosition;
uniform mat4 _mvp;
uniform vec2 singleStepOffset;
varying vec2 blurCoordinates[9];
void main(){
  gl_Position = _mvp*aPosition;
  blurCoordinates[0] = gl_Position.xy*0.5+0.5;
  blurCoordinates[1] = blurCoordinates[0]+vec2(-singleStepOffset.x,-singleStepOffset.y);
  blurCoordinates[2] = blurCoordinates[0]+vec2( 0.0,               -singleStepOffset.y);
  blurCoordinates[3] = blurCoordinates[0]+vec2( singleStepOffset.x,-singleStepOffset.y);
  blurCoordinates[4] = blurCoordinates[0]+vec2( singleStepOffset.x, 0.0);
  blurCoordinates[5] = blurCoordinates[0]+vec2( singleStepOffset.x, singleStepOffset.y);
  blurCoordinates[6] = blurCoordinates[0]+vec2( 0.0,                singleStepOffset.y);
  blurCoordinates[7] = blurCoordinates[0]+vec2(-singleStepOffset.x, singleStepOffset.y);
  blurCoordinates[8] = blurCoordinates[0]+vec2(-singleStepOffset.x, 0.0);
}

precision mediump float;
uniform sampler2D _tex[3];
varying vec2 vTextureCoord;
void main(void) {
  float y,u,v;
  y=texture2D(_tex[0],vTextureCoord).r;
  u=texture2D(_tex[1],vTextureCoord).r-0.5;
  v=texture2D(_tex[2],vTextureCoord).r-0.5;
  y=1.1643*(y-0.0625);
  gl_FragColor.r=y+1.5958*v;
  gl_FragColor.g=y-0.39173*u-0.81290*v;
  gl_FragColor.b=y+2.017*u;
  gl_FragColor.a=1.0;
}

