void main(void) {
  float y,u,v,a;
  y=texture2D(_tex[0],vTextureCoord).r;
  u=texture2D(_tex[1],vTextureCoord).r-0.5;
  v=texture2D(_tex[2],vTextureCoord).r-0.5;
  y=1.1643*(y-0.0625);
  gl_FragColor =vec4(y+1.5958*v,y-0.39173*u-0.81290*v,y+2.017*u,1.0);
  u = vTextureCoord.x*texTrans.x-texTrans.y;
  v = vTextureCoord.y*texTrans.z-texTrans.w;
  gl_FragColor = gl_FragColor * texture2D(_tex[3],vec2(u,v)).r;
}

